import imgPerfil from './img/1570104031199.jpeg';
import './App.css';

function App() {
  return (
    <div className="body">
      <header className="App-header">
        <div className='barra-lateral border-gradient border-gradient-purple'>

        <span></span>
        <img src={imgPerfil} className="img-perfil" alt="perfilImage" />

        </div>


      </header>
    </div>
  );
}

export default App;
